import './App.css';
import Flashcards from "./Flashcard";
import Footer from "./Footer"

import Header from "./Header"

function App(){
  return (
    <div className="App">
      <div>
        <div className="Background2"></div>
        <div className="Background"></div>
      </div>

      <Header />

      <Flashcards />        

      <footer>
        <Footer />
      </footer>

    </div>
  )
}

export default App;
